    rev_id_current: null
    fields:
      body:
        -
          value: "<p><span>Stetoskoplar alan elin veren eli görmeyeceği şekilde ihtiyaç sahiplerine ulaştırılacaktır.</span></p>\r\n\r\n<p><span>Umuyoruz ki bu sorununuzu çözdüğünüzde, siz de genç meslektaşlarınıza yardım edebilecek konuma gelirsiniz.</span></p>\r\n\r\n<p><span>Kampanyanın duyurulması için aşağıdaki etiket ve bağlantıyı sosyal medya hesaplarınızda paylaşarak çevrenize yayabilir ve stetoskop ihtiyacını kendisi karşılayamayan dönem arkadaşlarınıza yardımcı olabilirsiniz. </span></p>\r\n\r\n<p><span>Haydi dayanışmaya!</span></p>\r\n\r\n<p><span>#AskıdaStetoskop</span></p>\r\n\r\n<p><span>#SteteskopsuzTıbbiyeliOlmaz</span></p>\r\n"
          summary: ''
          format: basic_html
